// SignUpForm.js
import React, { useState } from 'react';
import Box from '@mui/material/Box';
import Input from '@mui/material/Input';
import InputLabel from '@mui/material/InputLabel';
import InputAdornment from '@mui/material/InputAdornment';
import FormControl from '@mui/material/FormControl';
import TextField from '@mui/material/TextField';
import AccountCircle from '@mui/icons-material/AccountCircle';
import Visibility from '@mui/icons-material/Visibility';
import VisibilityOff from '@mui/icons-material/VisibilityOff';
import { Link } from 'react-router-dom';
import IconButton from '@mui/material/IconButton';
import './SignUpForm.css';
import Alert from './Alert';
import { useAuthentication } from './useAuthentication';

function SignUpForm() {
  const [showPassword, setShowPassword] = useState(false);
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [alert, setAlert] = useState({ open: false, severity: 'success', message: '' });

  const { handleSignIn } = useAuthentication();

  const handleClickShowPassword = () => setShowPassword((show) => !show);

  const handleMouseDownPassword = (event) => {
    event.preventDefault();
  };

  const handleUsernameChange = (event) => {
    setEmail(event.target.value);
  };

  const handlePasswordChange = (event) => {
    setPassword(event.target.value);
  };

  const showAlert = (message, severity) => {
    setAlert({ open: true, severity, message });

    // Ocultar la alerta despuÃ©s de 3 segundos
    setTimeout(() => {
      setAlert({ ...alert, open: false });
    }, 3000);
  };

  const handleCloseAlert = () => {
    setAlert({ ...alert, open: false });
  };

  const handleSignInButtonClick = () => {
    handleSignIn(email, password, showAlert);
  };

  return (
    <div className='main-conatiner '>
      <div className='signUp_container'>
        <div className='input_form_login'>
          <h1>Sign In to your Account</h1>
          <Box sx={{ '& > :not(style)': { m: 1 } }}>
            <Box sx={{ display: 'flex', alignItems: 'flex-end' }}>
              <AccountCircle sx={{ color: 'action.active', mr: 1, my: 0.5 }} />
              <TextField
                id='input-with-sx'
                label='Email'
                variant='standard'
                value={email}
                onChange={handleUsernameChange}
              />
            </Box>
            <FormControl sx={{ m: 1, width: '25ch' }} variant='standard'>
              <InputLabel htmlFor='standard-adornment-password'>ContraseÃ±a</InputLabel>
              <Input
                id='standard-adornment-password'
                type={showPassword ? 'text' : 'password'}
                value={password}
                onChange={handlePasswordChange}
                endAdornment={
                  <InputAdornment position='end'>
                    <IconButton
                      aria-label='toggle password visibility'
                      onClick={handleClickShowPassword}
                      onMouseDown={handleMouseDownPassword}
                    >
                      {showPassword ? <VisibilityOff /> : <Visibility />}
                    </IconButton>
                  </InputAdornment>
                }
              />
            </FormControl>
          </Box>
          <div className='btn_register'>
            <Link to="/">
              <button className='btn--outline' onClick={handleSignInButtonClick}>
                SIGN IN
              </button>
            </Link>
          </div>
          <Alert {...alert} onClose={handleCloseAlert} />
        </div>
        <div className='register_container'>
          <h1> No tienes cuenta todavÃ­a?</h1>
          <p>Crea una ahorita mismo</p>
          <div className='btn_register'>
            <Link to="/register">
              <button className='btn-outline' to='/register'>
                Registrarse
              </button>
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
}

export default SignUpForm;
